import React from "react";

let Home = () => {
    return (
        <>
            <main>
                <div className="left">
                    <h1>Grow Your Business With<br /> <span>Jenil Soni</span></h1>
                    <p>We Are Team Of Talanted Developers Making Website</p>
                    <button>Get Started</button>
                </div>
                <div className="right">
                    <image src="https://i0.wp.com/dusrasoft.com/wp-content/uploads/2022/09/Web-Development.jpg" />
                </div>
            </main>
        </>
    )
}

export default Home;
